", "Japan", "RAT:1.37 : 1", "60", "Italy", "Australia", "Family", "RAT:1.78 : 1", "Crime", "Mexico", "RAT:1.85 : 1", "Horror", "India", "Adventure", "Music", "Italian", "Portuguese", "Dolby Digital", "PFM:Video", "-", "RAT:16:9 HD", "MET:300 m", "Mystery", "RAT:2.35 : 1", "Los Angeles California USA", "Biography", "Argentina", "Sport", "OFM:Video", "USA:R", "Fantasy", "Denmark", "New York City New York USA", "Australia:G", "Dolby", "History", "Brazil", "Hindi", "Netherlands", "Russian", "West Germany", "Musical", "USA:X", "Sci-Fi", "90", "Philippines", "7", "Western", "12", "OFM:16 mm", "10", "OFM:Live", "Reality-TV", "UK:15", "Dutch", "Sweden:15", "USA:30", "War", "Argentina:13", "Greece", "UK:PG", "5", "Filipino", "Finland", "USA:60", "15", "8", "Argentina:60", "Argentina:Atp", "Australia:MA", "Buenos Aires Federal District Argentina"}', 'pg_catalog.text'::regtype, -1)::anyarray, array_in('{" ...so the toughest bloke in the toughest pub sent me down a beer . . . I know I''m only 21 but I AM the gun shearer . . .", "$15,000", "$29,058,170 (USA) (18 April 2004)", "$50", "$96,729,762 (USA) (20 August 2000)", "1,623,790 (France) (27 April 1999)", "14", "22", "42", "70", "9", "A promotional video is being made to extol the virtues of Bayview and several residents are to have speaking parts,including Basil,who sees himself as the new James Bond Tom and Jenny. The excitement is such that few will heed Diana''s view that it is just another money-making scam by the idiot Baines - except Tom,who joins her in sabotaging the project by substituting footage of Marion and Geoffrey giving a rather more realistic look at life.", "Alice Walker: Well what did you do all day?::Mason Morgan: Read ran played with the dog.::Alice Walker: ...Isn''t that what you do every day? I just think it''s frivolous to read day in and day out with no action.::Mason Morgan: ...I''m an economist it''s what I do.::Alice Walker: I''m an economist it''s what I do.::Mason Morgan: Seriously. I just got my Ph.D... Yeah. It''s Dr. Mason Morgan to you from now on. Definitely.::Alice Walker: ...Yeah you don''t share huh? You''re a selective sharer. You cut your sharing short you''re a share cropper.", "Argentina:16", "Australia:10 April 2012", "Australia:M", "Balki Bartokomous: Well I got to tell you I broke down and cried ''til my eyes fell out!", "Belgium:5 March 2008", "Brazil:10", "Bulgaria:7 April 1980", "CBS Studio Center - 4024 Radford Avenue Studio City Los Angeles California USA", "CONT: The scene where Joy is bombarded with files on her desk before the scene where Jack is punched appears again when she is talking to her boss about the birthday party she went to with her wearing the same outfit.", "Canada:14A", "Canada:G", "Chile:November 2011", "Created for Hothouse the National Film Board of Canada''s emerging filmmaker apprenticeship program in 2011 ''Black Gold'' was Canadian artist Aimee van Drimmelen''s first introduction to hand drawn animation. Featuring her signature organic ink drawings and time lapse footage of ink moving on the surface of a drum skin.", "DATE: The Spider-Man pillow sheet that Eric has is wrong because the font that''s being used wasn''t introduced until the 90s.", "Denmark:21 June 1971", "Dolby SR", "Edward Christian: Who are you anyway?::Homer Simpson: Do the words executive producer mean anything to you?::Mel Gibson: Executive producer?::Homer Simpson: We''ll talk.", "FACT: When General Tyler enters the briefing room prior to the Africa flight nobody stands up as would have been normal military protocol (when he leaves everyone properly stands up).", "Finland:13 March 1986", "Finland:K-16", "France:14 July 2007", "France:30 March 2003", "Geneseo New York USA", "Germany:18 September 2003", "Germany:5 August 2005", "Greece:55", "Hollywood Florida USA", "Hungary:15 October 1943", "Iceland:L", "Indonesian", "Italy:14 January 1992", "Japan in 1598. War has raged for ten years. The last samurai standing begins his journey home after asking Kotou his old sword to protect him one final time. The walk home is long. In the shadow of Mount Fuji the samurai is challenged by a ninja who will let him pass in peace only if he gives him Kotou. The samurai refuses; a fight ensues. Does the old sword still have it?", "Japan:2012", "Japan:9 April 2008", "Kelli: Hi are you the new daddy?::Marvin: I''m your daddy. [wheeze] I''m not your daddy! I''m your baby''s daddy! Er - I''m not your *baby''s* daddy! I''m gonna be... I mean I''m-a... I''m-a... I''m...::Phil: You''re Marvin...::Marvin: ...Marvin.", "LAB:Rank Film Laboratories Denham UK", "Long Beach California USA", "MET:200 m", "Malayalam", "Mexico:12 December 2008", "Movie", "Netherlands:16", "News", "Nurse Lewis: What did you say your friends name was again please?::Templeton Peck: Eh Lothar Quint. With a Q. You''ve probably seen him on daytime soap operas. Had a big guest role on ''Search for Tomorrow''. Played a pro quarterback who turns psychic.Yeah he was just marvelous.", "PCS:Dyaliscope", "Paul and Barry make their entry into the highly competitive cut and thrust world of advertising as they attempt to stick their bill posters around Rotherham. It certainly becomes competitive when they find that they are vying with another bill poster for the prime spots. And not just competitive but rather messy as well.", "Poland", "Portugal:24 March 2007", "RAT:1.66 : 1", "Richard hosts a review of the season highlights in Southern California. From the city to the islands to the desert Richard explores every aspect of this rich landscape. Richard encounters a creepy desert dweller a turtle that lives in a power plant and a fox you won''t find anywhere else in the world.", "SYNC: When Dr Fenner admits Roper into his consulting room his mouth is visibly moving as he closes the door but no dialogue accompanies him on the soundtrack.", "She-Ra: Nobody pushes me around Hordak!", "South Korea:10 March 2005", "Spain:14 March 2009", "Spain:24 July 1997", "Spain:97", "Stuck in Human Traffick", "Sweden:8 March 2013", "Tampa Bay Buccaneers defensive end Greg White officially changed his name to Stylez G. White on December 15 2008. The inspiration for the name change came from ''Jerry Levine (I)'' (qv)''s character Stiles in Teen Wolf.", "The core production team is made up of Miami Florida natives.", "The sniper rifle that Sharice Walters uses appears to be a Barrett M82 with a modified scope.", "This video archive with accompanying essays traces internationally-renowned media and conceptual artist Peter Weibel''s artistic developments from his beginnings through 1979. Weibel started out in 1964 as a visual poet and was soon transferring the structures of the visual culture from the page to the screen while still retaining the model of language as one of perception. Later he developed a critical impulse that turned not only against art but also against society and the media itself. This specific development from the page via the screen to gallery space -- all happening as early as the 1960s -- anticipated many of the trends that were later to be described as conceptual art context art institutional criticism and intervention. With an accompanying booklet featuring contributions by Boris Groys Günther Holler-Schuster Aaron Levy Osvaldo Romberg and Christa Steinle.", "Two best friends unemployed and with time to kill. They meet up in Antwerp where they decide to each walk an opposite direction and follow the Belgian border until they meet up with a bag full of stories.... A story loosely based on the same titled novel by Roberto Bolaño", "UK:15 October 1960", "UK:21 April 1995", "UK:30", "UK:August 1911", "USA:10 January 1914", "USA:12 June 2008", "USA:14 September 1966", "USA:16 November 1988", "USA:180", "USA:2 October 2004", "USA:2012", "USA:23 January 2006", "USA:26 April 2010", "USA:29", "USA:30 November 1990", "USA:5 January 2001", "USA:7 March 2013", "USA:9 June 2002", "USA:NC-17", "Universal Studios - 100 Universal City Plaza Universal City California USA", "West Germany:10 March 1980", "When is it time to look the other way?", "Zeus: Rise from your grave!", "£100,000", "€ 90,245 (Spain) (10 November 2002) (62 screens)"}', 'pg_catalog.text'::regtype, -1)::anyarray, NULL, NULL);
