09) She was the costume designer for the play, \"Turn of the Century,\" at the Goodman Theatre in Chicago, Illinois. Natasha Katz was lighting designer.", "(23 December 1998) Daughter, with husband ''Jon Hensley'' (qv), Sophie May, born.", "(January 1997) Nairobi Park, Kenya", "(November 2007) Pitching for the San Diego Padres, winner of the 2007 National League Cy Young Award.", "1 November 1908", "11 June 1925", "13 February 1877", "15 April 1973", "16 May 1927", "18 January 1989", "1900", "1967", "2 November 1982", "21 January 1924", "23 December 1941", "25 December 1989", "27 January 2008", "29 June 1908", "30 July 2000", "4 September 1924", "6 May 2007", "8 May 1947", "A top dancer from France (originally from Vietnam). She has been dancing since the age of 8, starting with hip hop as her first style. In 2001, she decided to pool her focus into her popping and locking and specialize in the funk style dances. Over the past decade Dey Dey has been learned from the pioneers of her art, the Electric Boogaloos, the Original Lockers and the French OG''s. She is one of the top female poppers in the world and travels far and wide to teach, compete, perform and judge.  Dey Dey made popping history when she became the first female World Popping Champion after winning the 2009 UK B-Boy Championship solo popping battle and Juste Debout in 2010. Dey Dey has since worked with numerous performing artists including the likes of DJ Martin Solveig, Katy Perry and Madonna. She has also performed all over the world with the dance company Montalvo-Hervieu, and is playing the role of Yoyo in the movie Streetdance 2 3D which will be released in March 2012.", "Alessia, ''Vittoria Belvedere'' (qv) and ''Laura Pausini'' (qv) are close friends.", "Appeared in the Sean Kingston video for \"Beautiful Girls\"", "Attended Long Beach Polytechnic High School.", "Barnsley, England, UK", "Billy Kidman was trained by Afa at the Wild Somoan School.", "Boston, Massachusetts, USA", "Bruckner, William Austin", "Celebrity hair stylist. Clients include ''Jennifer Aniston'' (qv) and ''Demi Moore'' (qv).", "Collects movies and memorabilia relating to great comedians such as Dennis Leary, Bill Hicks, Rodney Dangerfield, Lenny Bruce, Laurel and Hardy, Abbott and Costello, Marx Brothers, Fatty Arbuckle, Harold Lloyd and Three Stooges.", "Culpepper, Terry Franklin", "Decibels Debs", "Dubbing voice of ''Jorja Curtright'' (qv) in the Italian post-synchronized version of _Love Is a Many-Splendored Thing (1955)_ (qv) (L''amore è una cosa meravigliosa).", "Evanston, Illinois, USA", "Favourite actor, ''Gary Oldman'' (qv).", "Founder of the Goons radio show with ''Peter Sellers (I)'' (qv) and ''Harry Secombe'' (qv)", "Gill, Frederick", "Great Grandfather of Amber Watson. Grandfather of Michael Dean Ester.", "Has a daughter born in 2003.", "Hawn, Philip Mallory", "He was ''Doug Atchison'' (qv)''s roommate at USC.", "Her high school nickname was \"Frosty\".", "His protagonists are often ordinary characters caught in extraordinary and Horrific circumstances", "I see the new Latin artist as a pioneer, opening up doors for others to follow. And when they don''t open, we crowbar our way in.", "In July 1964, Mickey Rourke, fighting as Phil Rourke, won a 3-round decision over Roger Hough in an amateur boxing match in Miami, Florida.", "Is a popular Asian pop singer in Asia.", "Japanese actress/voice actress.", "Katarina Elizabeth Brisset was born August 20, 1993 at Lakeside Hospital in New Orleans, La. She was raised in Chalmette, La and now resides in Destrehan, La. She is 19 years old fresh out of high school and is going to school for to be a Psychologist. On the side she does Photography.", "Laurence Love Greed is a musician, working mainly at the world renowned AIR Studios in Hampstead, London, and with film composer Michael Price. Aged 24, he has already worked with the likes of Paul McCartney, Jay Z, Coldplay, George Michael, Will.I.Am and many others. He has also worked on some of the biggest film releases of the last few years, such as James Bond - Quantum of Solace (Marc Forster), and Milk (Gus Van Sant), Angels and Demons (Ron Howard), and Alice in Wonderland (Tim Burton).", "Los Angeles, California, USA (acute intestinal obstruction)", "Marblehead, Massachusetts, USA", "Merion Station, Pennsylvania, USA", "Most Valuable Player of the 2011 National League Championship Series.", "Named #74 on the Maxim magazine \"Hot 100 of 2005\" list.", "Nominated for Outstanding Performance by a Lead Actor, for \"Finian''s Rainbow\", Drama Desk [2010].", "Olson, Stephan G.", "Pal Joey (1963).", "Plainfield, Connecticut, USA", "Prague, Czechoslovakia", "Raised in the Chicago suburbs.", "Robert Drake. _Flannery O''Connor._ Grand Rapids, Michigan, USA: Wm. B. Eerdmans Publishing Co.,", "Santa Fe, Argentina", "She can''t leave home without a book to read in case things get boring.", "Sid", "Son of ''Kemal Seden (I)'' (qv)", "Stage: Hosted the \"Great Radio City Music Hall Spectacular\" show with the Rockettes, Flamingo Hilton, Las Vegas, NV, until 7/31/2000 (over 5000 performances).", "Sweden", "TV commercial: Embarq", "The Playboy of the Western World (1946). Comedy (revival). Written by ''John Millington Synge'' (qv). Directed by ''Guthrie McClintic'' (qv). Booth Theatre: 26 Oct 1946- 4 Jan 1947 (81 performances). Cast: Paul Anderson, Mary Diveny, Eithne Dunne, ''Julie Harris (I)'' (qv) (as \"Nelly\"), Robin Humphrey, Fred Johnson, Sheila Keddy, ''J.M. Kerrigan'' (qv) (as \"Michael James Flaherty\"), Dennis King, Jr., Barry Macollum, ''Burgess Meredith'' (qv) (as \"Christy Mahon\"), ''Mildred Natwick'' (qv) (as \"Widow Quin\"), J.C. Nugent, James O''Neill, ''Ford Rainey'' (qv) (as \"Townsperson\"), ''Maureen Stapleton'' (qv) (as \"Sara Tansey\"), Mary Lou Taylor, Mary Walker. Produced by Theatre Incorporated (''Richard Aldrich'' (qv): Managing Director).", "Tobias was born in London. He graduated from the Royal Academy of Dramatic Art (RADA) in 1998 and began his acting career in popular UK series such as Foyle''s War, Midsomer Murders, and Casualty. He also appeared in the controversial drama A Very Social Secretary. He is best known to international audiences as Marcus Junius Brutus in the television series Rome.  He had a major film role in The Low Down with Aidan Gillen and featured in the 2006 reboot of the James Bond franchise, Casino Royale. 2007 sees him appearing as William Elliot in ITV''s production of Jane Austin''s classic book, Persuasion and as Derrick Sington in the Channel 4 drama The Relief of Belsen.  On stage, his credits include the young teacher Irwin in Alan Bennett''s The History Boys and Michael Blakemore''s West End production of Three Sisters for which he was nominated for the Ian Charleson Award. He was a critically acclaimed Hamlet in Rupert Goold''s Hamlet at the Royal Theatre.", "Unused score: Tender Mercies (1983)", "Was a finalist for the Miss International World pageant", "Watson, Bruce Norrie", "Winner of the 2010 Pete Rozelle Radio-Television Award, given annually by the Pro Football Hall of Fame \"for longtime exceptional contributions to radio and television in professional football\".", "Younger sister of Catarina Correia Afonso Archer, Matilde Correia Afonso Archer (mother of Carlos Artur Correia Afonso Archer) and Miguel Correia Afonso Archer.", "_Bonnie & Clyde: The True Story (1992) (TV)_ (qv)", "Østre Toten, Norway"}', 'pg_catalog.text'::regtype, -1)::anyarray, NULL, NULL);
